import React from "react";
import { IoIosArrowDown, IoIosArrowUp } from "react-icons";

import { Container } from "./styles";
import Image from "react-bootstrap/Image";
import pizza from "../../assets/cheesecake.png";

export default function GridPizzas() {
  return (
    <Container id="containerElement">
      <GridTitle name="amp">AS MAIS PEDIDAS</GridTitle>
      <div>
        <GridItem>
          <Image src={pizza} />
          <div>
            <span>BRESINHA</span>
            <IoIosArrowUp size={30} onClick={() => alert("teste")} />
          </div>
        </GridItem>
      </div>
    </Container>
  );
}
